import './StyleFooter.css'
export const Footer = () => {
    return(
        <footer className="flex justify-center items-center flex-col p-4" style={{backgroundColor: '#4F4F4F', color: '#FFFFFF'}}>
            <h3>Thank you for being here, I hope that I've helped you with the solutions presented, pelase, consider connecting with me using the links bellow</h3>
            <div class="flex">
                <a href="https://instagram.com"><i className="icon-instagram"></i></a>
                <a href="https://facebook.com"><i className="icon-facebook2"></i></a>
                <a href="https://youtube.com"><i className="icon-youtube"></i></a>
                <a href="https://youtube.com"><i className="icon-linkedin"></i></a>

            </div>

        </footer>
    );
}
